import "./sidebar.css"
import React from 'react';
import logo from '../'; // Tell webpack this JS file uses this image.
console. log(logo); // /logo.84287d09.png.
function Header() {
// Import result is the URL of your image.
return <img src={logo} alt="Logo" />;
}

export default function Sidebar() {
    return (
        <div className="sidebar">
            <div className="sidebaritem">
                <span className="sidebartitle">ABOUT me</span>
                <img src="" alt="" />
            <p> Lorem ipsum dolor sit, amet consectetur adipisicing elit. Architecto minus voluptas culpa saepe repellat temporibus! Quisquam sequi aliquam dolore, impedit optio asperiores ea fugiat nihil sit praesentium blanditiis. Esse, fugit.
            </p>
            </div>
        </div>
    )
}
